//25.50.2.a.1 for j = 2^4 * 3^2* 5^7 * 23^3
P<x,y,z,w>:= ProjectiveSpace(Rationals(), 3);
P1 := ProjectiveSpace(Rationals(), 1);

j := [7636821432*x*y*z^8+28861184520*x*y*z^7*w+36222408960*x*y*z^6*w^2+49250213440*x*y*z^5*w^3+31286838500*x*y*z^4*w^4+27968249566*x*y*z^3*w^5+4060922575*x*y*z^2*w^6+6019911450*x*y*z*w^7+1192386325*x*y*w^8+18863581528*x*z^9+17894520056*x*z^8*w+29744493280*x*z^7*w^2+17867873160*x*z^6*w^3+12549947520*x*z^5*w^4+6134343180*x*z^4*w^5+17792063538*x*z^3*w^6+5326062785*x*z^2*w^7+4498470030*x*z*w^8+3388862475*x*w^9+18531651992*y^2*z^8-8049777112*y^2*z^7*w+1523100560*y^2*z^6*w^2-42569801440*y^2*z^5*w^3-33601881300*y^2*z^4*w^4-7552187590*y^2*z^3*w^5-13479886795*y^2*z^2*w^6+4629617890*y^2*z*w^7+4409447675*y^2*w^8-10257698624*y*z^9-43672038368*y*z^8*w-39623295272*y*z^7*w^2-82945076680*y*z^6*w^3-23412811240*y*z^5*w^4-47250179672*y*z^4*w^5-21762946380*y*z^3*w^6-6167141165*y*z^2*w^7-8715169270*y*z*w^8-3937273325*y*w^9-12004097336*z^10-7636821432*z^9*w-14224673592*z^8*w^2-3856435688*z^7*w^3-3596424480*z^6*w^4-19339519980*z^5*w^5-20037269166*z^4*w^6-12800939915*z^3*w^7-13291161700*z^2*w^8-417703995*z*w^9+1278535900*w^10, 203193901*x*y*z^8+2382639570*x*y*z^7*w-2424513860*x*y*z^6*w^2-16740725200*x*y*z^5*w^3+20605532150*x*y*z^4*w^4+15344508920*x*y*z^3*w^5-20943298700*x*y*z^2*w^6+4423143200*x*y*z*w^7+1192386325*x*y*w^8-57565227*x*z^8*w+2901451340*x*z^7*w^2+7422771460*x*z^6*w^3-24353588600*x*z^5*w^4-10789879630*x*z^4*w^5+51809317160*x*z^3*w^6-16373064500*x*z^2*w^7-10105795800*x*z*w^8+3388862475*x*w^9+104978045*y^2*z^8+6213302290*y^2*z^7*w+8419621620*y^2*z^6*w^2-46818299100*y^2*z^5*w^3+4668427150*y^2*z^4*w^4+81123402820*y^2*z^3*w^5-44187596520*y^2*z^2*w^6-9028940100*y^2*z*w^7+4409447675*y^2*w^8+260759128*y*z^9-444331945*y*z^8*w-14168900900*y*z^7*w^2-1319437310*y*z^6*w^3+63550143850*y*z^5*w^4-36496845740*y*z^4*w^5-60116417030*y*z^3*w^6+48557341230*y*z^2*w^7+618109300*y*z*w^8-3937273325*y*w^9-203193901*z^9*w-2138795040*z^8*w^2+3993013260*z^7*w^3+12212431990*z^6*w^4-35038689840*z^5*w^5+5863837230*z^4*w^6+37799506630*z^3*w^7-28950470530*z^2*w^8+3655746925*z*w^9+1278535900*w^10];
eqns := [x^2*y-x*y^2+2*y^3-x^2*z+x*y*z-3*y^2*z-x*z^2-y*z^2+z^3+2*x*y*w-2*y^2*w+y*z*w-y*w^2-w^3, x^2*y+2*x*y^2+3*y^3+x^2*z+x*y*z+y^2*z+x*z^2-y*z^2-z^3+x*y*w-3*y^2*w-2*y*z*w+y*w^2+w^3, 2*x^2*y-x*y^2-3*y^3-3*y^2*z-3*y*z^2-2*x*y*w-2*y^2*w-x*z*w+4*y*z*w+2*z^2*w-2*x*w^2-y*w^2-z*w^2-w^3, 2*x^3-x^2*y+y^3-x*y*z-4*x*z^2+y*z^2+2*z^3+x^2*w-2*x*y*w-y^2*w+x*z*w-y*z*w-z^2*w-x*w^2+2*y*w^2+2*z*w^2-3*w^3, 3*x*y^2+y^3-x*y*z-y^2*z+2*y*z^2+2*x^2*w+4*y^2*w-x*z*w-z^2*w+3*x*w^2-3*y*w^2-z*w^2+2*w^3, 3*x*y^2+y^3-x*y*z-y^2*z+2*y*z^2-x*y*w-y^2*w-3*x*z*w+2*y*z*w+z^2*w+2*y*w^2+2*w^3];

C := Curve(P, eqns);
A := AutomorphismGroup(C);
jmap := map<C->P1 | [j[1]*2^6*5^3, j[2]]>;
smallpts := PointSearch(C, 100);
//we found the special point and the known CM point
assert {jmap(Q) : Q in smallpts} eq {P1![0,1], P1![2^4 * 3^2* 5^7 * 23^3, 1]}; 
assert (A.1)(smallpts[1]) eq smallpts[2];

//show that there are no other rational points corresponding to these j-invariants by inverting the j-map
j := P1![2^4 * 3^2* 5^7 * 23^3, 1];
inv_image := j@@jmap;
assert Dimension(inv_image) eq 0;
assert #RationalPoints(inv_image) eq 1; //note that rational points provably returns the rational points in dim = 0
